        "rawContent": "As our project matures, we have always intended to reduce the $UNIBOT trading tax. \n\nHence, effective 9/7 6pm EST, the team is reducing their share of the trading tax to bring the total from 5% to 4%!\n\nPLUS, starting 9/15, ALL token holders eligible for revenue sharing will receive 2% of the $UNIBOT trading. The 2% was originally a limited-time bonus for our holders that participated in our token migration of June 2023, with other eligible holders receiving 1%. The change means 2% across the board for good, which means holders are getting 50% of the total trading tax now.\n\nThe new token tax structure (total of 4%):\n2% for Revenue Share\n1% for Liquidity Pool\n1% for Operations\n\nLastly, for new holders, auto-compounding will be enabled by default for revenue share starting tomorrow. You can visit our dashboard to opt out and receive ETH rewards instead.",
