        "lang": "en",
        "rawContent": "Unibot <> @OKX\n\nWe have closed a strategic partnership with @OKXweb3 to provide our users with optimal routing for swaps, enabling you to access the deepest liquidity and best price execution for your trades. This is Unibot's first step towards our first-in-class meta-aggregator that supports multi-dex and multi-hop swaps, powered by OKX Wallet\u2019s DEX. \n\nWith this integration, Unibot users are now able to swap using their preferred token (ETH, USDC) and our meta-aggregation engine will find the best route to execute the trade. For example, you can use USDC to buy Unibot through the bot now.\n\nStay tuned for upcoming initiatives that will demonstrate the full scope of this partnership. \ud83e\udd84\ud83e\udd16",
