        "lang": "en",
        "rawContent": "We are bringing a new UI to support swaps for all pairs (ETH/USDC) all from one place!\n\nNew Concepts:\n\n\"\u21cc\" symbol means that the button is used to toggle between values. So the \"\u21cc USDC\"  button would rotate between ETH, USDC with every click. \"\u21cc 1.0 ETH\" would rotate between 0.1 ETH, 0.25 ETH, 0.5 ETH, 1.0 ETH.\n\n\"\u270e\" symbol means that the button will prompt you to type in a response.\n\nBuy and sell transactions in the Telegram bot are no longer immediately sent after entering a token address. Now, when an address is entered, a swap summary is shown which includes a honeypot check, estimation of your expected amount out from the trade, and other useful details of the token.\n\nIf you'd prefer to immediately buy the token, you may simply enter the token address followed by a full-stop, \u201c.\u201d e.g. \"0xf819d9Cb1c2A819Fd991781A822dE3ca8607c3C9.\" would immediately buy $UNIBOT.\n\nOnboarding:\n\nIn order to facilitate a swift onboarding process for users, we will send a one-time message providing an explanation of the buttons.\n\nFinally, we are introducing the following enhancements:\n\n1. Watchlist Feature: This feature will display both \"Recently Entered Tokens\" and \"Watchlist Tokens\" for convenient access. Users can easily open and close this feature, simplifying the process of copying and pasting token information for a quick overview.\n\n2. Token Analysis Text Buttons: In token balances, each token will have an associated text button that provides access to detailed token data and its contract address. This improvement will offer users a more comprehensive understanding of the tokens in their portfolio.\n\n$UNIBOT \ud83e\udd16\ud83e\udd84",
